    return (
        <div>
            <main style={{height:"500px"}} className="row d-flex align-items-center">
            
            <Calendar/>
            
            <div className="col-md-6 col-sm-16">
                <img className="img-fluid" src={chair} alt=""/>

            </div>

           
        </main>
        </div>
    );
};

export default AppinmentMain;
